import React from "react";
import OverallLanguageRank from "./OverallLanguageRank";
import LanguageBarChart from "./LanguageBarChart";
import LanguageTable from "./LanguageTable";

const MainPage = () => {
  // 샘플 데이터
  const overallData = [
    { name: "JavaScript", value: 400 },
    { name: "Python", value: 300 },
    { name: "Java", value: 200 },
    { name: "C#", value: 100 },
    { name: "C++", value: 50 },
  ];

  const frontendData = [
    { name: "JavaScript", value: 400 },
    { name: "TypeScript", value: 300 },
    { name: "HTML/CSS", value: 250 },
  ];

  const backendData = [
    { name: "Python", value: 350 },
    { name: "Java", value: 300 },
    { name: "C#", value: 200 },
  ];

  const tableData = [
    { name: "JavaScript", usage: "65.36%", stars: "3.32K" },
    { name: "HTML/CSS", usage: "55.08%", stars: "3.32K" },
    { name: "SQL", usage: "49.43%", stars: "3.32K" },
  ];

  return (
    <div className="main-page">
      <header>
        <h1>실시간 언어 트렌드</h1>
      </header>
      <div className="charts-section">
        <OverallLanguageRank data={overallData} />
        <LanguageBarChart data={frontendData} title="프론트엔드 언어 순위" />
        <LanguageBarChart data={backendData} title="백엔드 언어 순위" />
      </div>
      <LanguageTable data={tableData} />
    </div>
  );
};

export default MainPage;
